import React from "react";
import "../App.css"

const Post = ({title,summary}) => {
  return (
    <div className="post">
      <div className="image">
        <img src="data:image/jpeg;base64," />
      </div>

      <div className="texts">
        <h2>Full House Battery back up coming later this year</h2>
        <p className="info">
          <span className="author">Vishwas Nalawade </span>

          <time>2023-01-06 16.45</time>
        </p>

        <p className="summary">
          In partnership with Dutton Books, Amazon Literary Partnership, and
          Feminist Press, Girls Write Now is thrilled to announce our newest
          publication, Girls Write Now On the Other Side of Everything: 2023,
        </p>
      </div>
    </div>
  );
};

export default Post;
